import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import AppNavbar from './Components/Nav';
import { BrowserRouter ,  Route ,Switch} from 'react-router-dom';
import ShowFilms from './Pages/HomeFilms';


function App() {
  return (
    <div>
    <BrowserRouter>
    <AppNavbar></AppNavbar>
    <Switch>
    <Route exact path='/Home' Component={ShowFilms}></Route>

     <ShowFilms></ShowFilms>

    </Switch>
    </BrowserRouter>
    </div>

  );
}

export default App;
